import React, {FC, ReactNode} from "react";


type AncmntAutoFormProps = {
    makeForm: () => ReactNode,
};

export const AncmntAutoForm: FC<AncmntAutoFormProps> = (props) => {
    const {makeForm} = props;

    return (
        <div>
            {makeForm()}
        </div>
    )
};
